import React from "react";
import {
  Typography,
  Grid,
  List,
  ListItem,
  ListItemButton,
  ListItemText,
  IconButton,
} from "@mui/material";
import Button from "@mui/material/Button";
import FileDownloadOutlinedIcon from "@mui/icons-material/FileDownloadOutlined";

const dowonloadInfo = [
  ["ダウンロードファイル名1", "備考1"],
  ["ダウンロードファイル名2", "備考2"],
  ["ダウンロードファイル名3", "備考3"],
  ["ダウンロードファイル名4", "備考4"],
  ["ダウンロードファイル名5", "備考5"],
];
function Downloads() {
  return (
    <Grid
      id="item_8"
      className="Downloads"
      /* style={{ height: "80vh" }}*/
      container
      direction="column"
      justifyContent="center"
      alignItems="center"
      style={{ width: "50vw" }}
    >
      <Grid item xs={8} md={5}>
        <Typography variant="h4" align="center" mb={3}>
          各種ダウンロード
        </Typography>
      </Grid>
      <Grid
        item
        container
        direction="column"
        justifyContent="center"
        alignItems="center"
        xs={8}
        md={6}
      >
        {dowonloadInfo.map((item: any, _index) => {
          return (
            <List key={_index}>
              <ListItem disablePadding>
                <ListItemButton
                  sx={{
                    textAlign: "left",
                    borderBottom: 0.5,
                    borderColor: "#e6e6e6",
                  }}
                  disableRipple
                >
                  <Grid item container direction="row">
                    <Grid item container direction="column">
                      <ListItemText
                        primary={item[0]}
                        primaryTypographyProps={{
                          color: "secondary",
                        }}
                      />
                      <ListItemText
                        primary={item[1]}
                        primaryTypographyProps={{
                          color: "secondary",
                        }}
                      />
                    </Grid>
                    <Grid item container>
                      <IconButton
                        color="primary"
                        aria-label="upload picture"
                        component="label"
                      >
                        <FileDownloadOutlinedIcon />
                      </IconButton>
                    </Grid>
                  </Grid>
                </ListItemButton>
              </ListItem>
            </List>
          );
        })}
      </Grid>
    </Grid>
  );
}

export default Downloads;
